import React from 'react';
import styled from 'styled-components';
import Layout from '../components/Layout';

const PrivacyContainer = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 4rem 2rem;
  @media (max-width: 768px) {
    padding: 2rem 1rem;
  }
`;

const PrivacyTitle = styled.h1`
  font-size: clamp(2rem, 4vw, 3rem);
  font-weight: 700;
  color: #222;
  margin: 0 0 3rem 0;
  line-height: 1.2;
`;

const PrivacySection = styled.section`
  margin-bottom: 3rem;
`;

const SectionTitle = styled.h2`
  font-size: 1.5rem;
  font-weight: 600;
  color: #222;
  margin: 0 0 1.5rem 0;
  line-height: 1.3;
`;

const SectionText = styled.p`
  font-size: 1rem;
  color: #666;
  line-height: 1.7;
  margin: 0 0 1.5rem 0;
`;

const List = styled.ul`
  font-size: 1rem;
  color: #666;
  line-height: 1.7;
  margin: 0 0 1.5rem 0;
  padding-left: 1.5rem;
`;

const ListItem = styled.li`
  margin-bottom: 0.5rem;
`;

const ContactInfo = styled.div`
  background: #f8f8f8;
  padding: 2rem;
  border-radius: 8px;
  margin-top: 2rem;
`;

const ContactTitle = styled.h3`
  font-size: 1.2rem;
  font-weight: 600;
  color: #222;
  margin: 0 0 1rem 0;
`;

const ContactText = styled.p`
  font-size: 1rem;
  color: #666;
  line-height: 1.7;
  margin: 0 0 0.5rem 0;
`;

const LastUpdated = styled.div`
  font-size: 0.9rem;
  color: #999;
  margin-top: 3rem;
  padding-top: 2rem;
  border-top: 1px solid #eee;
  text-align: center;
`;

const Privacy = () => {
  return (
    <Layout>
      <PrivacyContainer>
        <PrivacyTitle>Personvernerklæring for Hepta AS</PrivacyTitle>
        <SectionText>
          Denne personvernerklæringen forklarer hvordan Hepta AS samler inn og bruker personopplysninger.
        </SectionText>

        <PrivacySection>
          <SectionTitle>1. Behandlingsansvarlig</SectionTitle>
          <SectionText>
            Hepta AS er behandlingsansvarlig for personopplysninger som samles inn og behandles i forbindelse med våre tjenester.
          </SectionText>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>2. Hvilke personopplysninger vi samler inn</SectionTitle>
          <SectionText>Vi kan samle inn følgende personopplysninger:</SectionText>
          <List>
            <ListItem>Kontaktinformasjon (navn, e-postadresse, telefonnummer)</ListItem>
            <ListItem>Brukerinformasjon (brukernavn, passord)</ListItem>
            <ListItem>Betalingsinformasjon</ListItem>
            <ListItem>Informasjon om din bruk av våre tjenester</ListItem>
          </List>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>3. Formål med behandlingen</SectionTitle>
          <SectionText>Vi behandler personopplysninger for følgende formål:</SectionText>
          <List>
            <ListItem>Å levere og forbedre våre tjenester</ListItem>
            <ListItem>Å kommunisere med deg</ListItem>
            <ListItem>Å behandle betalinger</ListItem>
            <ListItem>Å overholde juridiske forpliktelser</ListItem>
          </List>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>4. Rettslig grunnlag for behandlingen</SectionTitle>
          <SectionText>Vi behandler personopplysninger basert på følgende rettslige grunnlag:</SectionText>
          <List>
            <ListItem>Oppfyllelse av avtale</ListItem>
            <ListItem>Berettiget interesse</ListItem>
            <ListItem>Samtykke</ListItem>
            <ListItem>Rettslig forpliktelse</ListItem>
          </List>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>5. Deling av personopplysninger</SectionTitle>
          <SectionText>
            Vi deler kun personopplysninger med tredjeparter når det er nødvendig for å levere våre tjenester eller når vi er juridisk forpliktet til det.
          </SectionText>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>6. Lagring av personopplysninger</SectionTitle>
          <SectionText>
            Vi lagrer personopplysninger så lenge det er nødvendig for å oppfylle formålene beskrevet i denne personvernerklæringen, eller så lenge vi er pålagt å gjøre det i henhold til gjeldende lovgivning.
          </SectionText>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>7. Dine rettigheter</SectionTitle>
          <SectionText>Du har rett til å:</SectionText>
          <List>
            <ListItem>Få innsyn i personopplysningene vi har om deg</ListItem>
            <ListItem>Be om retting eller sletting av personopplysninger</ListItem>
            <ListItem>Be om begrensning av behandlingen</ListItem>
            <ListItem>Protestere mot behandlingen</ListItem>
            <ListItem>Motta personopplysningene i et strukturert, alminnelig anvendt og maskinlesbart format</ListItem>
          </List>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>8. Informasjonskapsler (cookies)</SectionTitle>
          <SectionText>
            Vi bruker informasjonskapsler for å forbedre brukeropplevelsen på vår nettside. Du kan administrere dine preferanser for informasjonskapsler i nettleserinnstillingene.
          </SectionText>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>9. Endringer i personvernerklæringen</SectionTitle>
          <SectionText>
            Vi kan oppdatere denne personvernerklæringen fra tid til annen. Vi vil informere om vesentlige endringer på vår nettside.
          </SectionText>
        </PrivacySection>

        <PrivacySection>
          <SectionTitle>10. Kontaktinformasjon</SectionTitle>
          <SectionText>
            Hvis du har spørsmål om vår behandling av personopplysninger, kan du kontakte oss på:
          </SectionText>

          <ContactInfo>
            <ContactTitle>Hepta AS</ContactTitle>
            <ContactText>E-post: personvern@hepta.no</ContactText>
          </ContactInfo>
        </PrivacySection>

        <LastUpdated>Sist oppdatert: 30-03-2025</LastUpdated>
      </PrivacyContainer>
    </Layout>
  );
};

export default Privacy;
